INSERT INTO public.issues VALUES ('BPThiago/oraculo-documentation', 3048942547, 'I_kwDOOb61Zc61uyvT', 'https://api.github.com/repos/BPThiago/oraculo-documentation/issues/25', 'https://api.github.com/repos/BPThiago/oraculo-documentation', 'https://api.github.com/repos/BPThiago/oraculo-documentation/issues/25/labels{/name}', 'https://api.github.com/repos/BPThiago/oraculo-documentation/issues/25/comments', 'https://api.github.com/repos/BPThiago/oraculo-documentation/issues/25/events', 'https://github.com/BPThiago/oraculo-documentation/issues/25', 25, 'closed', '[Feaure] Integração a uma interface para o usuário', '{"id": 152039280, "url": "https://api.github.com/users/liviahombre", "type": "User", "login": "liviahombre", "node_id": "U_kgDOCQ_vcA", "html_url": "https://github.com/liviahombre", "gists_url": "https://api.github.com/users/liviahombre/gists{/gist_id}", "repos_url": "https://api.github.com/users/liviahombre/repos", "avatar_url": "https://avatars.githubusercontent.com/u/152039280?v=4", "events_url": "https://api.github.com/users/liviahombre/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/liviahombre/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/liviahombre/followers", "following_url": "https://api.github.com/users/liviahombre/following{/other_user}", "user_view_type": "public", "organizations_url": "https://api.github.com/users/liviahombre/orgs", "subscriptions_url": "https://api.github.com/users/liviahombre/subscriptions", "received_events_url": "https://api.github.com/users/liviahombre/received_events"}', 'Esta feature tem como objetivo integrar toda a solução (VannaAI, banco de dados PostgreSQL, automações com n8n) à interface OpenWebUI, proporcionando uma experiência de conversa em linguagem natural para os usuários. A interface permitirá que o usuário faça perguntas e receba respostas diretamente, com o backend lidando com a geração e execução de queries em tempo real.

A OpenWebUI será configurada para encaminhar as mensagens do usuário para o fluxo do n8n, que orquestra a chamada ao VannaAI e executa a query no banco de dados. A resposta será formatada e retornada ao usuário pela própria interface do OpenWebUI.', NULL, '[{"id": 8479247418, "url": "https://api.github.com/repos/BPThiago/oraculo-documentation/labels/Feature", "name": "Feature", "color": "48DAED", "default": false, "node_id": "LA_kwDOOb61Zc8AAAAB-WcMOg", "description": ""}]', '{"id": 152039280, "url": "https://api.github.com/users/liviahombre", "type": "User", "login": "liviahombre", "node_id": "U_kgDOCQ_vcA", "html_url": "https://github.com/liviahombre", "gists_url": "https://api.github.com/users/liviahombre/gists{/gist_id}", "repos_url": "https://api.github.com/users/liviahombre/repos", "avatar_url": "https://avatars.githubusercontent.com/u/152039280?v=4", "events_url": "https://api.github.com/users/liviahombre/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_url": "https://api.github.com/users/liviahombre/starred{/owner}{/repo}", "followers_url": "https://api.github.com/users/liviahombre/followers", "following_url": "https://api.github.com/users/liviahombre/following{/other_user}", "user_view_type": "public", "organizations_url": "https://api.github.com/users/liviahombre/orgs", "subscriptions_url": "https://api.github.com/users/liviahombre/subscriptions", "received_events_url": "https://api.github.com/users/liviahombre/received_events"}', '[{"id": 152039280, "url": "https://api.github.com/users/liviahombre", "type": "User", "login": "liviahombre", "node_id": "U_kgDOCQ_vcA", "html_url": "https://github.com/liviahombre", "gists_url": "https://api.github.com/users/liviahombre/gists{/gist_id}", "repos_url": "https://api.github.com/users/liviahombre/repos", "avatar_url": "https://avatars.githubusercontent.com/u/152039280?v=4", "events_url": "https://api.github.com/users/liviahombre/events{/privacy}", "site_admin": false, "gravatar_id": "", "starred_u